@rliessum Hoi! We willen de beschikbare producten zo eerlijk mogelijk verdelen onder al onze klanten. Zo helpen we elkaar een beetje.
Deze maatregel geldt niet voor zakelijke klanten, zo kunnen bijvoorbeeld zorginstellingen voldoende boodschappen blijven bestellen.
^Koen

