@Patrick4all Bedankt voor alle informatie Patrick. Ik ga dit doorzetten naar onze leverancier, zodat dit uitgezocht kan worden.
Je mag natuurlijk op vertoon van dit berichtje of de kassabon een nieuwe verpakking in de winkel halen. 
