@roy Hoi Roy, hieronder wat je ongeveer aan houdbaarheidstermijn kan verwachten:

-Zuivel, Sojaproducten, voorverpakte vleeswaren en lunchsalades (voor op brood) - minimaal 4 dagen houdbaar
- Overige versartikelen - minimaal 2 dagen houdbaar 1/3 ^Jimmy

@kittykijktmee Zuivel, Sojaproducten, voorverpakte vleeswaren en lunchsalades - minimaal 4 dagen houdbaar
Overige versartikelen - minimaal 2 dagen houdbaar
Maaltijdsalades, stoommaaltijden, fruitsalades, verse sappen, smoothies en gebak - minimaal 2 dagen houdbaar.    ^Lies

